def decode_base64_image(size, data):

	msg = base64.b64decode(data)
	buf = io.BytesIO(msg)
	
	i = Image.open(buf)
	i.thumbnail(size, Image.ANTIALIAS)
	
	# adding transparent padding before text
	new_image = Image.new('RGBA', (size[0]+5, size[1]), (0, 0, 0, 0))
	new_image.paste(i, (0, 0))
	
	return new_image